import logo from './logo.svg';
import './App.css';

import Xml from './Xml';
import Csvp from './Csvp';
import Json from './Json';

import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

function App() {
  return (
    <div className='Parentbox'>
      <div className='Kopimahal'>
        <h1>Kelompok PABW Kopi Mahal</h1>
      </div>
      <div className='Garis'></div>
      <div className="Link-halaman">
        <h1>Pilih Halaman</h1>
        <table>
          <tr><a href=''>halaman csv</a></tr>
          <tr><a href=''>halaman xml</a></tr>
          <tr><a href='https://www.petanikode.com/contact.html'>halaman json</a></tr>
        </table>
      </div>

      <div className="Halaman">
        <Router>
          <Route path="/Xml" component={Xml} />
          <Route path="/Csvp" component={Csvp} />
          <Route path="/Json" component={Json} />
        </Router>
      </div>

    </div>
  );
}

export default App;
